🌳 El viejo árbol observa el universo en movimiento.

✨Otra de las composiciones de la noche en compañía de @_antonio.garcia_ y @juanluispourtau .
Gran parte de la noche el cielo estuvo encapotado, eso no impidió que pudiéramos pasar un par de horas capturado esta traza de estrellas.

📷 La composición ha sido realizada íntegramente con el 11mm f2.8 de @brightin.star .Su focal ultra gran angular facilita enormemente la creación de composiciones que integran un primer plano llamativo y un fondo lleno de detalles.

😌 Cualquier consulta que tengáis sobre este increíble objetivo, dejad vuestro comentario. Responderé con mucho gusto. 

📷 Si quieres seguir viendo fotos como esta guarda la foto en favoritos si te gusta y etiqueta a alguien con quien quieras compartirla. 
